import { BrowserRouter as Router, Route } from 'react-router-dom';
import MainNavigation from './shared/components/Navigation/MainNavigation';
import Post from './POSTS/pages/Post';
import Login from './Users/Pages/Login';
import Register from './Users/Pages/Register';
import Footer from './screen/Footer';
import HomeView from './screen/HomeScreen';
import React from 'react';
import HowItWorks from './screen/HowItWorks';
import CandidateScreen from './screen/CandidateScreen';
import CandidatePost from './POSTS/pages/CandidatePost';
import PostScreen from './screen/PostScreen';
import AdminUsersScreen from './screen/AdminUsersScreen';
import AdminPostsScreen from './screen/AdminPostsScreen';
import AdminVotResultsScreen from './screen/AdminVotResultsScreen';
import ProfileScreen from './screen/ProfileScreen';
import EditProfileScreen from './screen/EditProfileScreen';
// import UserListScreen from './screen/UserListScreen';
import EditUserScreen from './screen/EditUserScreen';
import CreatePost from './screen/CreatePost';
import CandidateProfile from './POSTS/components/CandidateProfile';
// import EmployeesForm from './shared/components/UIElements/EmployeesForm';

function App() {
  return (
    <Router>
      <MainNavigation />
      <Route path='/' exact>
        <HomeView />
        <HowItWorks />
        <Post />
        <Footer />
      </Route>
      <Route path='/post/:id/' component={PostScreen} exact />
      <Route path='/login' component={Login} exact />
      <Route path='/register' component={Register} exact />
      <Route path='/candidates' exact>
        <CandidateScreen />
        <CandidatePost />
      </Route>
      <Route path='/admin/users' component={AdminUsersScreen} exact />
      <Route path='/admin/user/:id/edit' component={EditUserScreen} exact />
      <Route path='/admin/posts' component={AdminPostsScreen} exact />
      <Route path='/admin/posts/edit' component={CreatePost} exact />
      <Route path='/admin/voting' component={AdminVotResultsScreen} exact />
      <Route path='/user/profile' component={ProfileScreen} exact />
      <Route path='/candidate/profile' component={CandidateProfile} exact />
      <Route path='/user/profile/edit' component={EditProfileScreen} exact />
    </Router>
  );  
}

export default App;
